		//פונקציה שעושה בדיקה של מצב המסיחים כרגע
		function checkItem() {
			var getRnd = stage.getChildByName("Rnd");
			isPlayermove = true; //התרת שליטה למשתמש
		
			if (incorrectCounter < 10 && correctCounter < 9) {
				TrueOrFalse = Math.floor((Math.random() * 2));
				mesiahRnd = Math.floor((Math.random() * answer[mychoice][TrueOrFalse].length));
				createRnd();
			}
		
			if (incorrectCounter == 10) { //אם הוגרלו כל המסיחים השגויים
				TrueOrFalse = 0; //תגריל את המסיח הנכון
				mesiahRnd = Math.floor((Math.random() * answer[mychoice][TrueOrFalse].length));
				createRnd();
			}
			if (correctCounter == 9) { //אם הוגרלו 9 מסיחים נכונים מתוך כולם
				TrueOrFalse == 1; //תגריל מסיח שגוי
				mesiahRnd = Math.floor((Math.random() * answer[mychoice][TrueOrFalse].length));
				createRnd();
			}
			if (correctCounter == 10) { //אם הוגרלו כל המסיחים הנכונים
				EndLine(); //עבור לאנימציית סיום
			}
		}
		
