				var rndX = Math.floor((Math.random() * myarry.length));
				stage.addChild(rn);
				rn.x = myarry[rndX];
				rn.y = -50;
				rn.name = "Rnd";
				getRnd = stage.getChildByName("Rnd");
				rn.addChild(showPic);
